  @IsString()
  @IsNotEmpty()
  nome;

  @IsEmail()
  @IsNotEmpty()
  email;

  @IsString()
  @IsNotEmpty()
  senha;

  @IsEnum(['admin', 'cliente'])
  @IsNotEmpty()
  tipoUsuario;
}

module.exports = ClienteDTO;

